import React from 'react'
import '../styling/language-focus.css'

const LanguageFocus = ({ language, languageRatio, repos }) => {

    return (
        <div className='lang-container'>
            <div className='header'>
                <h1>{language}</h1>
                <div className='ratio-container'>
                    <div className='ratio'>
                        <h1>{ languageRatio }</h1><h4>%</h4>
                    </div>
                </div>
            </div>
            <div className='repos-list'>
                {/* Check if repos is defined and has length */}
                {repos && repos.length > 0 ? (
                    repos.map((repo, index) => (
                        <div key={index} className='repo-item'>
                            <h3>{repo.name}</h3> {/* Example: Displaying repo name */}
                            <p>{repo.description}</p> {/* Example: Displaying repo description */}
                            {/* Add more details as needed */}
                        </div>
                    ))
                ) : (
                    <p>No repositories available.</p> 
                )}
            </div>
        </div>
    )
}

export default LanguageFocus
